    "national-status-and-trends-guanica-puerto-rico-contaminants-data",nt"isopen":
    false,nt"url": null,nt"notes": "This project assesses chemical contaminant
    status in sediment and coral tissues (Porites astroides) collected in and around
    Guanica Bay, Puerto Rico in 2009. Parameters monitored include sediment and coral
    tissue chemistry for over 100 organic and inorganic contaminants; and Clostridium
    perfringens (pathogen) concentrations. NOAA's National Status and Trends program
    regularly quantifies PAHs, PCBs, chlorinated pesticides including DDT and its metabolites,
    TBT and its metabolites, and trace elements nationwide.",nt"license_title":
